import { UniversalContext } from "./App";
import NavTop from "./NavTop";
import Footer from "./Footer";

function ProjectListItem(props) {
  // console.log('props',props)
  const projectContext = useContext(UniversalContext);
  // console.log("project context", projectContext.projects);
  const data = projectContext.projects;
 console.log('proJects',data);


const singleProject = data.projects.map((project) => {
  if (project.title === props.match.params.title) {
    return (
            <div className="project-title">{project.title}
            <img src={project.title} alt="users"></img></div>
    );
  }
});
console.log("props.match.params", singleProject);
return (
  <div className="login">
    <NavTop />

    {singleProject}
    <Footer />
  </div>
);
}

export default ProjectListItem;
